                        </div>
                        <div className="selectTypesPremiesElement">
                            <input type="checkbox" name="type_premies"/>
                            <label for="no">Фильр 1</label>
                        </div>
                        <div className="selectTypesPremiesElement">
                            <input type="checkbox" name="type_premies"/>
                            <label for="no">Фильр 1</label>
                        </div>
                    </div>
                </form>
            </div>
  	);
}

export default Filters;
